import React from "react";

const ToolCard = ({ tool }) => (
  <div className="tool-card">
    <h2>{tool.name}</h2>
    <p>{tool.description}</p>
    <p><strong>Type:</strong> {tool.category}</p>
    <p><strong>Price:</strong> {tool.price}</p>
    <a href={tool.link} target="_blank" rel="noreferrer">Visit Site</a>
  </div>
);

export default ToolCard;
